import { Link } from "react-router-dom";
import "./welcome.css";


const Welcome = () => {
   return (
      <div className="containerWelcomePage">
         <div className="welcomeStylePage">
            <span><Link to="/login">Sign In</Link></span>
            <span><Link to="/register">Sign Up</Link></span>

         </div>
      </div>
   )
}

export default Welcome;
